\begin{itemize}
\setlength\itemsep{-0.5em}
\item {\footnotesize detect begin and end timestamps of words}
\item {\footnotesize make use of note onsets detected automatically}
\begin{enumerate}
\item {\footnotesize phoneme transition rules aware of note onsets}
\item {\footnotesize alter transition probabilities according to the rules}
\end{enumerate}
\item {\footnotesize evaluate on a cappella and polyphonic \\ Turkish Makam}
\end{itemize}

\begin{itemize}
\setlength\itemsep{-0.5em}
\item {\footnotesize 12 acappella recordings, 18 minutes}
\item {\footnotesize especially recorded for this study}
\item {\footnotesize words and note onsets annotated}
\end{itemize}

\begin{itemize}
\item Onset-aware transition probabilities improve alignment
\begin{itemize}
\item Rules R1 and R3 discourage \\ premature transitions of vowels
\item No contribution for onsets not complying with rules \\ and at sustained vowels 
\end{itemize}
\item Lightweight model
\item Could be easily combined with other modeling concepts
\end{itemize}
